window.bookSummaryJSON = "<p>\"Intensely emotional and so exciting. It's brilliant, I could not put it down.\" (Caroline's Reviews)<br> </p> <p><b>Tristan</b><br> </p> <p><b>I have a big appetite....</b><br> </p> <p>A huge and very particular appetite for a blonde, curvy, shifter who just happens to be my partner on my next mission. <br> As a soldier of the Fae Corps, I must keep my hands off her, or risk the anger of both the Fae and the shifters. <br> No problem then. I have the perfect solution.<br> Temporary relationship? Check.<br> Giving her multiple o's? You bet.<br> Making her come until she’s completely lost sight of anything else but me and what I can do to her? That’s my specialty, folks. <br> ....and, you know what else?<br> I’ve never felt like this before. <br> This time it’s about her. Her needs, her pleasure. <br> I plan to keep her high on endorphins, make sure she is fulfilled in a way she’s never been before. <br> A few hours - okay maybe days - that's all I'll need to make her submit; we'll then go our separate ways.<br> At least that was my plan.<br> Then I realized she was my fated mate, mine and everything changed....<br> </p> <p><b>Note: </b><b><i>Property of the Fae</i></b><b> , is a stand-alone paranormal romance novel, and the second book in the emotional and exciting Fae's Claim Series.</b></p> <p><b>Features a snarly, possessive, FAE male, intense love scenes, and action-packed suspense that will keep you turning the pages. Buy now!</b></p>"; 
